import React from "react";
import styles from "./DesktopBackground.module.css";
import desktop from "../images/bg-main-desktop.png";

const Desktop = () => {
  return (
    <React.Fragment>
      <img src={desktop} alt="desktop" />
    </React.Fragment>
  );
};

export default Desktop;
